import {BrowserRouter as Router, Route, Routes} from 'react-router-dom';
import "./App.css";
import CHAT from "./components/chat/CHAT";

function App() {
  return (

      <Router>
        <div>
      <Routes>
        <Route path="/" element={CHAT}/>
      </Routes>
      </div>
      </Router>

  );
}

export default App;
